import 'dart:collection';

class Solution {
  int find(int a, List<int> parent) {
    if (parent[a] != a) parent[a] = find(parent[a], parent);
    return parent[a];
  }

  void union(int a, int b, List<int> parent, List<int> rank) {
    int rootA = find(a, parent);
    int rootB = find(b, parent);
    if (rootA != rootB) {
      if (rank[rootA] > rank[rootB]) {
        parent[rootB] = rootA;
      } else if (rank[rootB] > rank[rootA]) {
        parent[rootA] = rootB;
      } else {
        parent[rootB] = rootA;
        rank[rootA] += 1;
      }
    }
  }

  bool canTraverseAllPairs(List<int> nums) {
    int n = nums.length;
    List<int> parent = List.generate(n, (i) => i);
    List<int> rank = List.generate(n, (i) => 0);
    HashMap<int, List<int>> map = HashMap();

    for (int i = 0; i < n; i++) {
      int num = nums[i];
      for (int factor = 2; factor * factor <= num; factor++) {
        if (num % factor == 0) {
          map.putIfAbsent(factor, () => []);
          for (int index in map[factor]!) {
            union(i, index, parent, rank);
          }
          map[factor]!.add(i);

          while (num % factor == 0) {
            num ~/= factor;
          }
        }
      }
      if (num > 1) {
        map.putIfAbsent(num, () => []);
        for (int index in map[num]!) {
          union(i, index, parent, rank);
        }
        map[num]!.add(i);
      }
    }

    int root = find(0, parent);
    for (int i = 1; i < n; i++) {
      if (find(i, parent) != root) return false;
    }
    return true;
  }
}
